import React, { useState } from 'react'

function ReturnedProducts({allProducts}) {
    const [returned, setReturned] = useState([])
  return (
    <table className="productTable">
          <thead>
            <tr>
              <th>Name</th>
              <th>Category</th>
              <th>Stock</th>
            </tr>
          </thead>
          <tbody>
            {allProducts.map((product) => {
              return (
                <tr key={product._id}>
                  <th>{product.name}</th>
                  <th>{product.category}</th>
                  {product.inStock ? <th>In Stock</th> : <th>Rented</th>}
                </tr>
              );
            })}
          </tbody>
        </table>
  )
}

export default ReturnedProducts
